import React, { useContext } from 'react'
import { AppContext, useGlobalContext } from './context'
import { FaBars } from 'react-icons/fa'

const Home = () => {

  const { openSidebar, openModal } = useGlobalContext();

  return (
    <main>
      <button
        className='sidebar-toggle'
        onClick={openSidebar}
      >
        <FaBars />
      </button>

      <button
        className='btn'
        onClick={openModal}
      >
        show modal
      </button>
    </main>
  )
}

export default Home
